import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ReactiveFormsModule, FormsModule } from '@angular/forms';
import { AlbumRoutingModule } from './album-routing.module';
import { AlbumListComponent } from './album-list/album-list.component';
import { AlbumDetailComponent } from './album-detail/album-detail.component'
import { CommentCreatorComponent } from '../comment/comment-creator/comment-creator.component';


@NgModule({
  declarations: [AlbumListComponent, AlbumDetailComponent, CommentCreatorComponent],
  imports: [
    CommonModule,
    AlbumRoutingModule,
    FormsModule,
    ReactiveFormsModule
  ],
  exports: [AlbumListComponent, CommentCreatorComponent]
})
export class AlbumModule { }
